import React from 'react';

import Header from '../common/Header';
import Footer from '../common/Footer';
import Slidebar from '../common/Sidebar';

import AdminQuoteReq from './AdminQuoteReq';
import ManageInventory from './ManageInventory';
import ManageOperations from './ManageOperations';


class AdminDashboard extends React.Component {
    constructor(props) {
        super(props);
    }
    state = {
        pageName: '1'
    }
    switchPage(e) {
        this.setState({
            pageName: e.target.dataset.id
        });
    }

    render() {
        return (
            <React.Fragment>
<Header />

<div class="container">
  <h2>Toggleable Pills</h2>

  <ul class="nav nav-pills" role="tablist">
    <li class="nav-item">
      <a class="nav-link active" data-toggle="pill" href="#home">Home</a>
    </li>
    <li class="nav-item">
      <a class="nav-link" data-toggle="pill" href="#menu1">Menu 1</a>
    </li>
    <li class="nav-item">
      <a class="nav-link" data-toggle="pill" href="#menu2">Menu 2</a>
    </li>
  </ul>


  <div class="tab-content">
    <div id="home" class="container tab-pane active">
      <h3>HOME</h3>
      <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.</p>
    </div>
    <div id="menu1" class="container tab-pane fade">
      <h3>Menu 1</h3>
      <p>Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.</p>
    </div>
    <div id="menu2" class="container tab-pane fade">
      <h3>Menu 2</h3>
      <p>Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam.</p>
    </div>
  </div>
</div>



                <div className="page-body row">
                    <Slidebar onClick={this.switchPage.bind(this)}></Slidebar>

                    {(() => {

                        switch (this.state.pageName) {
                            case '1':
                                return (
                                    <AdminQuoteReq></AdminQuoteReq>
                                )
                            case '2':
                                return (
                                    <div>You are a Manager.</div>
                                )
                            case '5':
                                return (
                                    <ManageInventory></ManageInventory>
                                )
                            case '6':
                                return (
                                    <ManageOperations></ManageOperations>
                                )
                            default:
                                return (
                                    <div>You are a User.</div>
                                )
                        }

                    })()}

                </div>
                <Footer></Footer>
            </React.Fragment>
        )
    }
}

export default AdminDashboard;
